webpackJsonp([58152383453204],{447:function(t,e){t.exports={data:{markdownRemark:{html:'<!---\nThis is an autogenerated file!\n\nPlease do not edit this file directly, but instead make changes to the\nsigs.yaml file in the project root.\n\nTo understand how this file is generated, see https://git.k8s.io/community/generator/README.md\n-->\n<h1>Big Data Special Interest Group</h1>\n<p>Covers deploying and operating big data applications (Spark, Kafka, Hadoop, Flink, Storm, etc) on Kubernetes. We focus on integrations with big data applications and architecting the best ways to run them on Kubernetes.</p>\n<h2>Meetings</h2>\n<ul>\n<li>\n<p>Regular SIG Meeting: <a href="https://zoom.us/my/sig.big.data">Wednesdays at 17:00 UTC</a> (weekly). <a href="http://www.thetimezoneconverter.com/?t=17:00&#x26;tz=UTC">Convert to your timezone</a>.</p>\n<ul>\n<li><a href="https://docs.google.com/document/d/1pnF38NF6N5eM8DlK088XUW85Vms4V2uTsGZvSp8MNIA/edit">Meeting notes and Agenda</a>.</li>\n<li><a href="https://docs.google.com/document/d/1pnF38NF6N5eM8DlK088XUW85Vms4V2uTsGZvSp8MNIA/edit">Meeting recordings</a>.</li>\n</ul>\n</li>\n</ul>\n<h2>Leadership</h2>\n<h3>Chairs</h3>\n<p>The Chairs of the SIG run operations and processes governing the SIG.</p>\n<ul>\n<li>Anirudh Ramanathan (<strong><a href="https://github.com/foxish">@foxish</a></strong>), Rockset</li>\n<li>Erik Erlandson (<strong><a href="https://github.com/erikerlandson">@erikerlandson</a></strong>), Red Hat</li>\n<li>Yinan Li (<strong><a href="https://github.com/liyinan926">@liyinan926</a></strong>), Google</li>\n</ul>\n<h2>Contact</h2>\n<ul>\n<li><a href="https://kubernetes.slack.com/messages/sig-big-data">Slack</a></li>\n<li><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data">Mailing list</a></li>\n<li><a href="https://github.com/kubernetes/community/labels/sig%2Fbig-data">Open Community Issues/PRs</a></li>\n</ul>\n<h2>GitHub Teams</h2>\n<p>The below teams can be mentioned on issues and PRs in order to get attention from the right people.\nNote that the links to display team membership will only work if you are a member of the org.</p>\n<p>The google groups contain the archive of Github team notifications.\nMentioning a team on Github will CC its group.\nMonitor these for Github activity if you are not a member of the team.</p>\n<table>\n<thead>\n<tr>\n<th>Team Name</th>\n<th align="center">Details</th>\n<th align="center">Google Groups</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>@kubernetes/sig-big-data-api-reviews</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-api-reviews">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-api-reviews">link</a></td>\n<td>API Changes and Reviews</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-bugs</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-bugs">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-bugs">link</a></td>\n<td>Bug Triage and Troubleshooting</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-feature-requests</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-feature-requests">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-feature-requests">link</a></td>\n<td>Feature Requests</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-misc</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-misc">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-misc">link</a></td>\n<td>General Discussion</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-pr-reviews</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-pr-reviews">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-pr-reviews">link</a></td>\n<td>PR Reviews</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-proposals</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-proposals">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-proposals">link</a></td>\n<td>Design Proposals</td>\n</tr>\n<tr>\n<td>@kubernetes/sig-big-data-test-failures</td>\n<td align="center"><a href="https://github.com/orgs/kubernetes/teams/sig-big-data-test-failures">link</a></td>\n<td align="center"><a href="https://groups.google.com/forum/#!forum/kubernetes-sig-big-data-test-failures">link</a></td>\n<td>Test Failures and Triage</td>\n</tr>\n</tbody>\n</table>\n<!-- BEGIN CUSTOM CONTENT -->\n<h2>Goals</h2>\n<ul>\n<li>Design and architect ways to run big data applications effectively on Kubernetes</li>\n<li>Discuss ongoing implementation efforts</li>\n<li>Discuss resource sharing and multi-tenancy (in the context of big data applications)</li>\n<li>Suggest Kubernetes features where we see a need</li>\n</ul>\n<h2>Non-goals</h2>\n<ul>\n<li>\n<p>Endorsing any particular tool/framework</p>\n<!-- END CUSTOM CONTENT -->\n</li>\n</ul>'},site:{siteMetadata:{sigs:["sig-api-machinery","sig-apps","sig-architecture","sig-auth","sig-autoscaling","sig-aws","sig-azure","sig-big-data","sig-cli","sig-cloud-provider","sig-cluster-lifecycle","sig-cluster-ops","sig-contributor-experience","sig-docs","sig-gcp","sig-ibmcloud","sig-instrumentation","sig-multicluster","sig-network","sig-node","sig-openstack","sig-product-management","sig-release","sig-scalability","sig-scheduling","sig-service-catalog","sig-storage","sig-testing","sig-ui","sig-vmware","sig-windows"]}}},pathContext:{slug:"/sig-big-data/"}}}});
